import cooking from "../src/img/cooking.jpg"
import series from "../src/img/series.png"
import workout from "../src/img/workout.jpg"

const HobbiesData = [
    {
        imgsrc: workout,
        title: "Workout",
    },
    {
        imgsrc: cooking,
        title: "Cooking",
    },
    {
        imgsrc: series,
        title: "Watching Series and Movies",
    },

]
export default HobbiesData;
